// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import JekyllNavigation from './components/JekyllNavigation';
import ChatBot from './components/ChatBot';
import './styles.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <header className="site-header">
          <div className="header-content">
            <h1 className="site-title">Jason's Blog</h1>
            <JekyllNavigation />
          </div>
        </header>

        <main className="main-content">
          <Routes>
            <Route path="/chat" element={<ChatBot />} />
            <Route path="/" element={<div className="home-content">Home Page Content</div>} />
            {/* 其他路由 */}
          </Routes>
        </main>

        <footer className="site-footer">
          <p>&copy; {new Date().getFullYear()} Jason's Blog</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
